  return <h1>Hello, {props.name}</h1>;
}
const element = <Welcome name="Tyler" />;

ReactDOM.render(
  element,
  // <React.StrictMode>
  //   <App />
  // </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
